import { Container } from 'react-bootstrap';
import { Forum } from './Forum.ts';
import { ForumItem } from './ForumItem.tsx';

type Props = {
  wpisy: Forum[];
};

function ForumPage({ wpisy }: Props) {
  return (
    <>
    <div className="tlo-custom position-absolute top-0 start-0 w-100 h-100"></div>
    <div className="position-relative p-3">
      <Container className='Wpis-custom m-4'>
        {wpisy.map((item, index) => (
          <ForumItem key={index} forum={item} />
        ))}
      </Container>
    </div>
    </>
  );
}

export default ForumPage;
